import React from 'react';
import { Box, colors, Typography, useTheme } from "@mui/material";
import { tokens } from "../theme";
import ProgressCircle from "./ProgressCircle";


const StatBox = ({ title, subtitle, icon, progress, increase}) => {
    const theme= useTheme();
    const colors = tokens(theme.palette.mode);
  return (
    <Box width="100" md="0 30px">
        <Box display="flex" justifyContent="space-between">
            <Box>
                {icon}
                <Typography
                  variant="h4"
                  fontWeight="bold"
                  sx={{color: colors.grey[100]}}

                >
                    {title}
                </Typography>
            </Box>
            <Box>
                <ProgressCircle progress={progress}/>
            </Box>
        </Box>
        <Box display="flex" justifyContent="space-betwwen" mt="2px">
            <Typography variant="h5" sx={{color: colors.greenAccent[500]}}>
                {subtitle}
            </Typography>
            <Typography variant="h5" fontstyle="italic" sx={{color: colors.greenAccent[600]}}>
                {increase}
            </Typography>
        </Box>

    </Box>
  )
}

export default StatBox;
